import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { View, Text, StyleSheet, Button, SafeAreaView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import 'react-native-gesture-handler';
import { createDrawerNavigator } from '@react-navigation/drawer';
import {createAppContainer,createSwitchNavigator} from 'react-navigation';
import Profile from './screens/Profile';
import Bookmark from './screens/Bookmark';
import Barcode from './screens/Barcode';
import Meeting from './screens/Meeting';
import MainContainer from './MainContainer';
import { Platform } from 'react-native';
import { createBrowserApp } from '@react-navigation/web';
const createApp= Platform.select({
 web:config=>createBrowserApp(config,{history:'hash'}),
 default:config=>createAppContainer(config),
});
const Drawer = createDrawerNavigator();

function Drawers() {
    return (
      <NavigationContainer>
        <Drawer.Navigator>
           <Drawer.Screen name="Xr-Sci" component={ MainContainer } />
           <Drawer.Screen name="Profile" component={ Profile } />
           <Drawer.Screen name="BarCode" component={ Barcode } />
           <Drawer.Screen name="Bookmark" component={ Bookmark } />
           <Drawer.Screen name="Meeting" component={ Meeting } />
        </Drawer.Navigator>
  
      </NavigationContainer>
    );
  }
  
  export default Drawers;
